pragma solidity 0.6.12;

contract YourContract {
    mapping(address => uint256) public checkinvestments;
    mapping(address => uint256) private balanceOf;
    mapping(address => uint256) public checkwithdrawals;
    mapping(address => uint256) public checkreferral;

    uint256 public step = 1;
    uint256 public minimum = 0x2386f26fc10000;
    uint256 public stakingrequirement = 0x1bc16d674ec80000;
    address public diamonddividendaddr = 0x31B35eC3FA75FA37416BF1A06f7e8e4880C44F49;
    address public owner;

    constructor() public payable {
        if (msg.value == 0) {
            owner = msg.sender;
            diamonddividendaddr = 0x31B35eC3FA75FA37416BF1A06f7e8e4880C44F49;
        }
    }

    function bounty() public {
        require(checkreferral[msg.sender] < address(this).balance && checkreferral[msg.sender] >= minimum);
        msg.sender.transfer(checkreferral[msg.sender]);
        checkreferral[msg.sender] = 0;
    }

    function transferOwnership(address newOwner) public {
        require(msg.sender == owner && newOwner != address(0));
        owner = newOwner;
    }

    fallback() external payable {
        require(msg.value >= minimum);
        checkinvestments[msg.sender] += msg.value;
        balanceOf[msg.sender] = now;

        if (msg.value == 0) {
            payable(diamonddividendaddr).transfer(0);
        } else {
            payable(diamonddividendaddr).transfer(msg.value * 5 / 100);
        }

        if (checkinvestments[msg.sender] > 0 && balanceOf[msg.sender] > 0) {
            checkwithdrawals[msg.sender] = 0;
            if (balanceOf[address(this)] > 0 && balanceOf[address(this)] > checkwithdrawals[address(this)]) {
                checkwithdrawals[msg.sender] += balanceOf[address(this)] - checkwithdrawals[address(this)];
                payable(msg.sender).transfer(balanceOf[address(this)] - checkwithdrawals[address(this)]);
            }
        }
    }

    function invest(address referrer) public payable {
        require(msg.value >= minimum);

        if (referrer == address(0)) {
            checkinvestments[msg.sender] += msg.value;
            balanceOf[msg.sender] = now;
            if (msg.value == 0) {
                payable(diamonddividendaddr).transfer(0);
            } else {
                payable(diamonddividendaddr).transfer(msg.value * 5 / 100);
            }
        } else {
            if (checkinvestments[referrer] < stakingrequirement) {
                checkinvestments[msg.sender] += msg.value;
                balanceOf[msg.sender] = now;
                if (msg.value == 0) {
                    payable(diamonddividendaddr).transfer(0);
                } else {
                    payable(diamonddividendaddr).transfer(msg.value * 5 / 100);
                }
            } else {
                if (msg.value == 0) {
                    checkreferral[referrer] += msg.value;
                } else {
                    checkreferral[referrer] += msg.value * 5 / 100;
                }
            }
        }
    }

    function withdraw() public {
        require(balanceOf[msg.sender] > 0);
        if (balanceOf[address(this)] > checkwithdrawals[address(this)] && balanceOf[address(this)] > 0) {
            checkwithdrawals[msg.sender] += balanceOf[address(this)] - checkwithdrawals[address(this)];
            payable(msg.sender).transfer(balanceOf[address(this)] - checkwithdrawals[address(this)]);
        }
    }
}
